import '../components/ExpenseItem.css';

function ExpenseItem() {
    const expenseDate = new Date(2023, 11, 28);
    const expenseTitle = 'PUC';
    const expenseAmount = 'Rs. 50';

  return (
    <div className='expense-item'>
          <div>{ expenseDate}</div>
      <div className='expense-item__description'>
              <h2>{expenseTitle}</h2>
        <div className='expense-item__price'>Rs. 50</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
